import logo from './logo.svg';
import './App.css';
import Home from './pages/home'
import logoImage from './4life.svg';
import React from 'react';
import { Route, Switch, Link, BrowserRouter as Router, Routes} from 'react-router-dom';

import MyMentee from './MyMentee';
import Mentee from './Mentee';
import { RiH1 } from 'react-icons/ri';
import MyMentees from './MyMentee';


function App() {
  return(
    <Router>
      <Routes>
        <Route path="/" element = {<Home/>}/>
        <Route path='/mentee' element = {<Mentee/>}/> 
        <Route path='/mymentee' elements = {<MyMentee/>}></Route>
        <Route path='*' element = {<h1>Not found</h1>}/>
      </Routes>
      </Router>


  )
}
export default App;
